import React, { useEffect } from 'react';
import Particles from 'react-tsparticles';
import "../../index.css"

const ParticleComponent = () => {
    useEffect(() => {
        // No need for additional initialization logic since react-tsparticles handles it internally
    }, []);

    return (
        <div id="tsparticles">
            <Particles
                id="tsparticles"
                options={{
                    background: {
                        color: {
                            value: "#ffffff"
                        }
                    },
                    particles: {
                        color: {
                            value: "#000000"
                        },
                        number: {
                            value: 100
                        },
                        size: {
                            value: 3
                        },
                        move: {
                            speed: 2
                        }
                    }
                }}
            />
        </div>
    );
};

export default ParticleComponent;
